import Header from './Header';
import Link from 'next/link';

const linkStyle = {
    marginLeft: 15,
    padding: 20,
    border: '1px solid #DDD'
};

const Layout = props => (
    <div style={linkStyle}>
        <Header />
        {props.children}
    </div>
);

export default Layout;
